    constructor(){
        this.state = {
            listOfTodos:['Todo1','ewfsdd']
        }
    }
    render(){
        return (
            <div className="">
                <div>Todo list to keep me bussy </div>
                <Form inline>
                    <Form.Control placeholder='Todo'></Form.Control>
                    <Button type="submit">Add</Button>
                </Form>
                <div>
                <ListGroup>
                { this.state.listOfTodos.map((value,idx)=>{

                <ListGroup.Item key={idx}>{value}</ListGroup.Item>
                })}
                    </ListGroup>
                </div>
            </div>
        )
    }
}
export default TodoList
